import React from 'react'
import {Link, Navigate} from 'react-router-dom'
import Logo from '../images/logo.png'

const Navbar = () => {
  return (
    <nav className="header">
       <div className="left">
        <span>The Blog App</span>
       </div>
    </nav>
  )
}

export default Navbar
